(21, 0, 'a) permanecem como reprodução dos valores e costumes africanos.', 'De acordo com o texto, a recuperação da herança cultural africana está relacionada ao que é \"próprio do processo cultural\" e como ele constrói o \"próprio rosto cultural brasileiro\". Dessa maneira, o autor do texto defende que a cultura brasileira, assim como sua experiência histórica, é formada não apenas pela cultura europeia dominante, mas também por aquelas culturas que foram secularmente negligenciadas, como a africana.', 5),
