(142, 0, 'd) A autonomia da sociedade civil seja proporcional ao desenvolvimento econômico.', 'Segundo Karl Marx e Friedrich Engels, o trabalho seria a expressão da vida humana, ou seja, por meio do trabalho o homem transforma a natureza e a si mesmo. Essa condição foi alterada na sociedade capitalista, em que o homem passa a explorar a força de trabalho do outro homem.', 19),
(143, 0, 'e) A burguesia revolucione o processo social de formação da consciência de classe.', 'Segundo Karl Marx e Friedrich Engels, o trabalho seria a expressão da vida humana, ou seja, por meio do trabalho o homem transforma a natureza e a si mesmo. Essa condição foi alterada na sociedade capitalista, em que o homem passa a explorar a força de trabalho do outro homem.', 19),
(144, 1, 'a) a herança da dialética hegeliana assumida por Karl Marx.', NULL, 20),
(145, 0, 'b) a filosofia de Marx com sua herança escolástica partilhada por Hegel.', 'No pensamento de Hegel a “ideia muda a sociedade” Marx no início irá seguir com esse pensamento, mas com o passar dos seus estudos ele irá acrescentar a isso a ideia materialista que é a transformadora da sociedade, ou seja, sua ação-mas para ele a herança de Helgel está fortemente ligada a todo esse processo', 20),
(146, 0, 'c) a perspectiva dialética do Homem, que permite considerá-lo capaz de conceituar termos científicos no aspecto ou feição do Universo.', 'No pensamento de Hegel a “ideia muda a sociedade” Marx no início irá seguir com esse pensamento, mas com o passar dos seus estudos ele irá acrescentar a isso a ideia materialista que é a transformadora da sociedade, ou seja, sua ação-mas para ele a herança de Helgel está fortemente ligada a todo esse processo', 20),
