(199, 0, 'b) a necessidade de qualificação profissional e a abertura das fronteiras para os imigrantes.', 'As migrações intensificaram-se recentemente em função de guerras e crises econômicas, em que grande parte da população deixa seu país em busca de melhores condições de vida. O aumento do número de pessoas ocupando países não nativos eleva a xenofobia, no país receptor desses imigrantes, levando muitos governantes a criarem barreiras para dificultar sua entrada.', 31),
