(203, 0, 'a) há uma política de controle e recepção dos grupos imigrantes.', 'Nos países desenvolvidos, há uma grande presença de imigrantes, que buscam melhores condições de vida e emprego. Esses imigrantes (sobretudo os ilegais) atendem à grande necessidade de mão de obra barata que esses países possuem, o que faz com que os fluxos migratórios se intensifiquem.', 32),
