(208, 0, 'a) pela incorporação de valores ocidentais no Oriente e de valores orientais no Ocidente, diminuindo as fronteiras simbólicas', 'Os principais fatores de incremento à migração internacional são os socioeconômicos. Muitas pessoas de países subdesenvolvidos deslocam-se em direção aos países centrais em busca de melhores salários, mesmo que exercendo empregos de menor status ou com condições trabalhistas menos vantajosas.', 33),
