(213, 0, 'a) as migrações voltam-se aos países mais próximos, tendo em vista as maiores facilidades existentes com as novas políticas de vizinhança que avançam no mundo atual.', 'A questão aborda a influência da globalização nas tendências migratórias mundiais. Se antes tínhamos migrações motivadas pela colonização ou pelos antecedentes étnicos, atualmente a versatilidade de parâmetros para a escolha da migração passa a ser mais ampla e abrangente.', 34),
