(248, 0, 'b) Pastagem, silvicultura e lavoura.', 'O governo instituiu restrições para a plantação de soja devido ao potencial prejudicial que ela confere ao solo florestal. A prática pecuária não possui restrições tão severas; assim, graças ao jeitinho brasileiro, os agricultores desmatam, avançam o gado e quando não há mais nada que caracterize o solo como área florestal, plantam a Soja. (Exploração de madeira -> Pastagem -> Lavoura).', 41),
