(267, 0, 'a) czaristas, que buscavam organizar a luta pela retomada do poder.', 'Os bolcheviques, ou comunistas, tentavam colocar ordem nos setores mais revolucionários, e lutavam pela formação de um governo baseados em conselhos operários ou sovietes, como eram chamados, que eram constituídos por operários, mas também por soldados e camponeses.\r\nEsse movimento era contrário a uma união com a burguesia. Mesmo com a mobilização, o governo foi formado em fevereiro por socialistas mais conciliador e a burguesia mais liberal.\r\n', 45),
