(287, 0, 'a) o mesmo sentido.', 'Duas retas paralelas entre si, na Geometria Euclidiana, nunca se encontram, ou seja, não há nenhum um ponto em comum entre elas e não há razão para falar em sentido sobre uma reta sem ela estar orientada. Portanto, duas retas paralelas entre si tão somente possuem em comum suas direções.', 49),
