(292, 0, 'a) Triangular e Escalar.', 'A regra do polígono diz que em toda figura fechada a soma do vetor R=0. Na verdade, somar vetores é “andar” vetores, em que no caso de uma figura fechada sai e volta-se ao mesmo ponto e logo o deslocamento foi nulo.', 50),
