(300, 1, 'a) 1680 J', NULL, 52),
(301, 0, 'b) 1867 J', 'Você pode resolver desta forma:\r\nQ= m* c* t\r\nQ= 0,3* 80* 70= 1680 J\r\n', 52),
(302, 0, 'c) 1976 J', 'Você pode resolver desta forma:\r\nQ= m* c* t\r\nQ= 0,3* 80* 70= 1680 J\r\n', 52),
(303, 0, 'a) a capacidade térmica do tabuleiro é maior que a do bolo.', 'Porque essa transferência de calor é nada mais que uma propagação de energia que ocorre de um corpo mais quente para um mais frio. Se ela queima a mão ao tocar no tabuleiro é porque ali há um maior acumulo de energia do que o bolo.', 53),
