(306, 0, 'a) 10 °C', 'Resumindo: é necessário descobrir o “Q” do gelo e da água para saber quem vai dar/receber energia e se haverá diferenças ou não. Fazendo a resolução abaixo (wilson junior), vê-se que, o “Q” do gelo é maior do que o da água, logo, a quantidade de água presente na mistura não será capaz de derretê-lo por completo. Como “sobrará” gelo, a água cederá o calor dela para entrar em equilíbrio chegando a 0 c°', 54),
(307, 1, 'b) 0 °C', NULL, 54),
