(432, 1, 'b) Quase todos os movimentos heréticos na Idade Média tinham como ponto de inspiração as crenças judaicas, o que levou a Igreja católica a empreender forte campanha anti-semita. ', NULL, 81),
(433, 0, 'c) Os movimentos heréticos na Idade Média tinham fortes vinculações com a influência da cultura muçulmana no Ocidente cristão. Em resposta a essas interferências culturais, os católicos resolveram empreender movimentos armados contra os muçulmanos que ficaram conhecidos como cruzadas. ', ' era quem tinha outra percepção do mundo, sem ter a obrigação de abandonar a fé ', 81),
(434, 0, 'd) A reforma católica proposta por Martin Lutero pode ser percebida como um movimento herético, do período medieval, que obteve êxito mesmo diante de toda a oposição da estrutura eclesiástica e de muitos príncipes vinculados ao Papa. ', ' era quem tinha outra percepção do mundo, sem ter a obrigação de abandonar a fé ', 81),
