(451, 0, 'a) os principais reformadores, como Lutero, não se envolveram nos desdobramentos políticos e socioeconômicos de suas doutrinas.', ' A reforma protestante também tinha cunho político, visto a intrínseca relação entre as instituições à época. A cisão com a igreja católica promoveu uma perspectiva reflexiva, uma segunda corrente para se seguir. ', 85),
(452, 0, 'b) o papado, por estar consciente dos desdobramentos da reforma, recusou-se a iniciá-la, até ser a isso obrigado por Calvino.', ' A reforma protestante também tinha cunho político, visto a intrínseca relação entre as instituições à época. A cisão com a igreja católica promoveu uma perspectiva reflexiva, uma segunda corrente para se seguir. ', 85),
(453, 0, 'c) a burguesia, ao contrário da nobreza e dos príncipes, aderiu à reforma, para se apoderar das riquezas da Igreja.', ' A reforma protestante também tinha cunho político, visto a intrínseca relação entre as instituições à época. A cisão com a igreja católica promoveu uma perspectiva reflexiva, uma segunda corrente para se seguir. ', 85),
(454, 0, 'd) os cristãos que aderiram à reforma estavam preocupados somente com os benefícios materiais que dela adviriam.', ' A reforma protestante também tinha cunho político, visto a intrínseca relação entre as instituições à época. A cisão com a igreja católica promoveu uma perspectiva reflexiva, uma segunda corrente para se seguir. ', 85),
(455, 1, 'e) o aparecimento dos anabatistas e outros grupos radicais são a prova de que a reforma extrapolou o campo da religião.', NULL, 85),
(456, 0, 'a) Empirismo X Criticismo', ' Francis Bacon é um dos principais expoentes do empirismo, enquanto que Descartes é o principal representante do racionalismo. Ambos desenvolveram métodos científicos, mas que partem de concepções epistemológicas bastante distintas. Enquanto Bacon enxerga na experiência a origem do conhecimento, Descartes considera que somente a partir da Razão pode-se conhecer alguma coisa verdadeiramente. ', 86),
(457, 0, 'b) Ceticismo X Existencialismo', ' Francis Bacon é um dos principais expoentes do empirismo, enquanto que Descartes é o principal representante do racionalismo. Ambos desenvolveram métodos científicos, mas que partem de concepções epistemológicas bastante distintas. Enquanto Bacon enxerga na experiência a origem do conhecimento, Descartes considera que somente a partir da Razão pode-se conhecer alguma coisa verdadeiramente. ', 86),
