(460, 0, 'e) Racionalismo X Ceticismo', ' Francis Bacon é um dos principais expoentes do empirismo, enquanto que Descartes é o principal representante do racionalismo. Ambos desenvolveram métodos científicos, mas que partem de concepções epistemológicas bastante distintas. Enquanto Bacon enxerga na experiência a origem do conhecimento, Descartes considera que somente a partir da Razão pode-se conhecer alguma coisa verdadeiramente. ', 86),
(461, 0, 'a) as Ciências não avançaram muito nesse período, pois sofriam a influência do Cristianismo.', ' nesse período, grandes progressos na Trigonometria e na Álgebra, além de se desenvolverem pesquisas sobre a refração da luz e se criarem fundamentos da óptica,mesmo assim as ciências não avançaram muito devido a influencia do cristianismo ', 87),
