(466, 0, 'a) a concepção de Galileu, acerca da Física, é considerada retrógrada, em virtude de sua forte convicção religiosa, que impedia as experiências práticas.', ' A mais famosa tese de Giordano Bruno, segundo a qual o universo é infinito e, portanto, não tem centro, está diretamente conectada à crítica do geocentrismo feita por Nicolau Copérnico, bem como sua defesa do heliocentrismo. ', 88),
(467, 0, 'b) os limites atribuídos às atividades científicas, desenvolvidas durante a Idade Moderna, decorriam da fusão entre o conhecimento científico e a prática de bruxaria.', ' A mais famosa tese de Giordano Bruno, segundo a qual o universo é infinito e, portanto, não tem centro, está diretamente conectada à crítica do geocentrismo feita por Nicolau Copérnico, bem como sua defesa do heliocentrismo. ', 88),
(468, 0, 'c) a importância de Galileu, no campo científico, tem por base a elaboração da teoria “geocêntrica”, que veio confirmar a concepção anteriormente defendida por Nicolau Copérnico.', ' A mais famosa tese de Giordano Bruno, segundo a qual o universo é infinito e, portanto, não tem centro, está diretamente conectada à crítica do geocentrismo feita por Nicolau Copérnico, bem como sua defesa do heliocentrismo. ', 88),
(469, 1, 'd) a ideia defendida por Galileu, segundo a qual o sol se encontrava no centro do universo, serviu como marco de afirmação do conhecimento científico. ', NULL, 88),
