(484, 0, 'a) Grafite, leite, água oxigenada, fósforo vermelho.', ' Ar - Nitrogênio, Oxigênio, Dióxido de carbono, gases nobres etc\r\nGranito - Quartzo, um mineral incolor; o Feldspato (ortóclase, sanidina e microclina), responsável pela\r\nvariedade de cores, dentre elas: avermelhada, rosada e creme-acinzentada; e a Mica (biotite e\r\nmoscovite).\r\nVinagre - solução aquosa de ácido acético\r\nágua sanitária - solução aquosa de hipoclorito de sódio (NaClO)', 92),
