(509, 0, 'a) condensação do líquido libera energia para o meio.', ' Pensando num recipiente de barro com água. Nós teremos a água no estado líquido. Dessa forma, ao ser aquecida pelo dia quente. O que irá ocorrer é uma evaporação na superfície. Essa evaporação absorve calor, removendo calor do sistema. Fazendo com que a água no estado líquido permaneça numa temperatura mais baixa. ', 97),
