(544, 0, 'a) os elementos de um mesmo grupo apresentam propriedades químicas semelhantes, no entanto o número de elétrons na camada de valência de átomos de um mesmo grupo sempre sofre variação.', ' A chave para acertar essa questão é o enunciado, que pergunta a organização sistemática da tabela atual. A tabela periódica atual é organizada em ordem crescente dos números atômicos, colocando em períodos, elementos com a mesma camada eletrônica; e nos mesmos grupos, elementos com características semelhantes. Observe que é exatamente por isso que os metais de transição interna estão “fora da tabela”, pois ia desorganizar a ideia de grupos com “características semelhantes”.\r\n', 104),
