(554, 0, 'a) I e II apenas.', ' Todas as alternativas estão corretas. O jogo de palavras opositivo de “pense menos” e “ame mais” privilegiam o sentimento (amar mais) a favor da razão (pense menos). Além disso, a propaganda busca, por meio da antítese criada entre os verbos “pensar” e “amar”, convencer o consumidor a deixar se levar pelos sentimentos e adquirir o produto. A hashtag torna a linguagem popular entre os jovens, que estão acostumados ao seu uso nas redes sociais. ', 106),
