(773, 0, 'b)  must - and - will - would - should', 'A frase onde está a primeira lacuna é “O que você deve/deveria saber antes de pular dentro.”, ou seja, as respostas possíveis seriam “Should”, “Must” e “Shell”. Já a segunda coluna pede uma palavra de contraste, e, entre as opções, só o “But” se encaixaria ali, assim, a alternativa A (should - but - may - can - if) é a única que se encaixa perfeitamente nas duas lacunas.', 156),
