(1, NULL, 'Na segunda metade do século XIX, a capoeira era uma marca da tradição rebelde da população trabalhadora urbana na maior cidade do Império do Brasil, que reunia escravos e livres, brasileiros e imigrantes, jovens e adultos, negros e brancos. O que mais os unia era pertencer aos porões da sociedade, e na última escala do piso social estavam os escravos africanos.\r\nSOARES, C. E. L. Capoeira mata um. In: FIGUEIREDO, L. História do Brasil para ocupados. Rio de Janeiro: Casa da Palavra, 2013.\r\nDe acordo com o texto, um fator que contribuiu para a construção da tradição mencionada foi a:', 3, 1),
(2, NULL, 'A Constituição Brasileira de 1988 considerou a Mata Atlântica como Patrimônio Nacional. Entretanto, grande parte de sua cobertura vegetal já havia sido destruída ao longo da história do Brasil devido: ', 3, 1),
(3, NULL, 'Quatro olhos, quatro mãos e duas cabeças formam a dupla de grafiteiros \"Os gêmeos\". Eles cresceram pintando muros do bairro Cambuci, em São Paulo, e agora têm suas obras expostas na conceituada em Nova Iorque, prova de que o grafite feito no Brasil é apreciado por outras culturas. Muitos lugares abandonados e sem manutenção pelas prefeituras das cidades tornam-se mais agradáveis e humanos com os grafites pintados nos muros. Atualmente, instituições públicas educativas recorrem ao grafite como forma de expressão artística, o que propicia a inclusão social de adolescentes carentes, demonstrando que o grafite é considerado uma categoria de arte aceita e reconhecida pelo campo da cultura e pela sociedade local e internacional.\r\nNo processo social de reconhecimento de valores culturais, considera-se que: ', 3, 1),
(4, NULL, 'A preocupação com a preservação do patrimônio cultural tem início no século XIX, quando o patrimônio passou a constituir interesse de vários países, surgindo a necessidade de se discutirem critérios para sua definição e gestão, através das cartas patrimoniais. Sobre as cartas patrimoniais, é correto afirmar: ', 3, 1),
(5, NULL, 'A recuperação da herança cultural africana deve levar em conta o que é próprio do processo cultural: seu movimento, pluralidade e complexidade. Não se trata, portanto, do resgate ingênuo do passado nem do seu cultivo nostálgico, mas de procurar perceber o próprio rosto cultural brasileiro. O que se quer é captar seu movimento para melhor compreendê-lo historicamente.\r\nMinas Gerais. Cadernos do Arquivo 1: Escravidão em Minas Gerais. Belo Horizonte: Arquivo Público Mineiro, 1988.\r\nCom base no texto, a análise de manifestações culturais de origem africana, como a capoeira ou o candomblé, deve considerar que elas: ', 3, 1),
(6, NULL, 'Em 29 de maio de 1829, oficiais ingleses abordaram o navio Veloz. “Os diários de bordo e mais papéis do capitão foram examinados … estavam em ordem. O número de pessoas transportadas obedecia ao que estipulava a lei…”\r\nGÓES José Roberto Pinto de Cordeiros de Deus: tráfico, demografia e política no destino dos escravos, em: Marco. A. Pamplona (org.) Escravidão, exclusão e cidadania, Rio de Janeiro, Access, 2001, p. 23\r\nCom base no texto acima e em seus conhecimentos, assinale a alternativa correta sobre o tráfico de escravos, durante o Império. ', 3, 1),
(7, NULL, 'A escravidão marcou profundamente as relações inter-raciais no tecido social do Brasil e dos Estados Unidos. Sobre as relações inter-raciais na atualidade, é correto afirmar: ', 3, 1),
(8, NULL, '“Congregando segmentos variados da população pobre ou dirigindo-se às áreas de mineração, onde se concentravam enormes contingentes de escravos, as vendeiras e negras de tabuleiro seriam constantemente acusadas de responsabilidade direta no desvio de jornais, contrabando de ouro e diamantes, prática de prostituição e ligação com os quilombos.”\r\nFIGUEIREDO, Luciano. O avesso da memória: cotidiano e trabalho da mulher em Minas Gerais no século XVIII. Rio de Janeiro: José Olympio, 1993.\r\nA partir da leitura e análise desse trecho, é CORRETO afirmar que a escravidão nas Minas Gerais se caracterizava por: ', 3, 1),
(9, NULL, 'Escrevendo em jornais, entrando para a política, fugindo para quilombos, montando pecúlios para comprar alforrias... Os negros brasileiros não esperaram passivamente pela libertação. Em vez disso, lutaram em diversas frentes contra a escravidão, a ponto de conseguir que, à época em que a Lei Áurea foi assinada, apenas uma pequena minoria continuasse formalmente a ser propriedade. Antes da Lei Áurea. Liberdade Conquistada.\r\nRevista Nossa História. Ano 2, nº 19. São Paulo: Vera Cruz, 2005.\r\nNo que diz respeito à Abolição, o texto apresenta uma análise historiográfica realizada nas últimas décadas por historiadores, brasileiros e brasilianistas, que se diferencia das análises mais tradicionais. Essa análise recente apresenta a extinção do regime escravista, em grande parte, como resultado: ', 3, 1);
INSERT INTO `questao` (`IdQuestao`, `Imagem`, `Enunciado`, `idMateria`, `idArea`) VALUES
(10, , 'Jean Baptiste Debret- Um funcionário a passeio com sua família.\r\n\r\nA pintura de Debret, datada de 1839, representa a sociedade brasileira do século XIX ao retratar: ', 3, 1);
INSERT INTO `questao` (`IdQuestao`, `Imagem`, `Enunciado`, `idMateria`, `idArea`) VALUES
(11, NULL, 'No ano 313 d.C., o imperador Constantino reconheceu o cristianismo como a religião oficial do Império Romano, por meio do Édito de Milão. Sobre o cristianismo na Antiguidade, é INCORRETO afirmar: ', 3, 1),
(12, NULL, 'A divisão do Império Romano em dois, em Império Romano do Oriente e Império Romano do Ocidente, repercutiu nas questões religiosas do cristianismo, das quais podemos citar o Cisma do Oriente, em 1054, que resultou: ', 3, 1),
(13, NULL, 'No processo que causou o fim do Império Romano do Ocidente, os povos germânicos cumpriram um papel fundamental para o enfraquecimento do poder de Roma. Selecione a alternativa que consta o nome de um povo que NÃO teve envolvimento com as invasões germânicas: ', 3, 1),
(14, NULL, '( ) E a situação sempre mais ou menos / Sempre uns com mais e outros com menos / A cidade não para, a cidade só cresce / O de cima sobe e o de baixo desce / (…)” Este trecho da música do pernambucano Chico Science (1966–1997) e grupo Nação Zumbi nos remete à vida em cidades, processo que passou a ser significativo na história, a partir do 4º milênio a.C., na Mesopotâmia.\r\nSobre esse processo, é correto afirmar: ', 3, 1),
(15, NULL, 'A construção da sociedade grega foi marcada pela montagem do escravismo enquanto modo de produção. Neste sentido, é correto afirmar: ', 3, 1),
(16, NULL, 'O trabalho teórico de Karl Marx está fundamentado no que ele chamava de concepção materialista da história. O período em que viveu foi marcado pelas grandes mudanças causadas pelo crescente processo de industrialização dos países europeus. Marx testemunhou o crescimento das indústrias e fábricas, o inchamento dos meios urbanos e o consequente aumento vertiginoso das desigualdades sociais.\r\nDe acordo com a concepção materialista, fundamentada por Marx e Friedrich Engels, as mudanças sociais que se passavam no decorrer da história humana estavam baseadas: ', 1, 1),
(17, NULL, 'Leia com atenção o texto a seguir. “Os homens fazem sua própria história, mas não a fazem como querem; não a fazem sob circunstâncias de sua escolha, e sim sob aquelas com que se defrontam diretamente, legadas e transmitidas pelo passado”.\r\nMARX, Karl. O Dezoito Brumário de Louis Bonaparte. São Paulo: Centauro, 2006.\r\nBaseado no texto, assinale a afirmação verdadeira: ', 1, 1),
(18, NULL, 'A análise da vida social deve ser realizada através de uma perspectiva dialética que, além de procurar estabelecer as leis de mudança que regem os fenômenos, esteja fundada no estudo dos fatos concretos, a fim de expor o movimento do real em seu conjunto.\r\nSão autores dessa proposição: ', 1, 1),
(19, NULL, '(ENEM - 2013) Na produção social que os homens realizam, eles entram em determinadas relações indispensáveis e correspondem a um estágio definido de desenvolvimento das suas forças materiais de produção. A totalidade dessas relações constitui a estrutura econômica da sociedade – fundamento real, sobre o qual se erguem as superestruturas política e jurídica, e ao qual correspondem determinadas formas de consciência social.\r\nMARX, K. Prefacio à crítica da economia política. In: MARX, K; ENGELS, F. Textos 3. São Paulo: Edições Socias, 1977 (adaptado).\r\nPara o autor, a relação entre economia e política estabelecida no sistema capitalista faz com que: ', 1, 1),
(20, NULL, 'Para Caio Prado Jr., A observação de Engels: “O núcleo que encerra as verdadeiras descobertas de Hegel… o método dialético na sua forma simples em que é a única forma justa do desenvolvimento do pensamento”, revela:', 1, 1),
(21, NULL, 'América Central é uma subdivisão do continente americano, sendo composta por 20 países. Marque a alternativa que não é composta apenas por países da América Central. ', 1, 1),
(22, NULL, 'Sobre o modelo de industrialização implementado em países do Sudeste Asiático, como Coréia do Sul e Taiwan e o adotado em países da América Latina, como a Argentina, o Brasil e o México, pode-se afirmar que: ', 1, 1),
(23, NULL, 'Para responder à questão, identifique as características comuns aos processos de industrialização do México, do Brasil e da Argentina. ', 1, 1),
(24, NULL, '(Enem 2017) México, Colômbia, Peru e Chile decidiram seguir um caminho mais curto para a integração regional. Os quatro países, em meados de 2012, criaram a Aliança do Pacífico e eliminaram, em 2013, as tarifas aduaneiras de 90% do total de produtos comercializados entre suas fronteiras.\r\nOLIVEIRA, E. Aliança do Pacífico se fortalece e Mercosul fica à sua sombra. O Globo, 24 fev. 2013 (adaptado).\r\nO acordo descrito no texto teve como objetivo econômico para os países-membros: ', 1, 1),
(25, NULL, 'O crescimento do Partido dos Trabalhadores vem-se constituindo num marco da vida nacional nas duas\r\núltimas décadas. Antes, um partido que limitava suas ações às greves operárias urbanas, o Partido dos\r\nTrabalhadores: ', 1, 1),
(26, NULL, 'Acerca dos quase oito anos de mandato do presidente Luís Inácio Lula da Silva no Brasil, assinale a única alternativa incorreta: ', 1, 1),
(27, NULL, 'Foi sancionado sem vetos pelo presidente Luiz Inácio Lula da Silva, o projeto de lei que cria o Estatuto da Igualdade Racial, que tem por objetivo promover políticas públicas de igualdade de oportunidades e combate à discriminação. Entre outras medidas, o estatuto prevê, EXCETO: ', 1, 1),
(28, NULL, '“O Brasil tem compromissos políticos de ajudar o continente africano a se desenvolver. O Brasil tem dívida histórica com os africanos, e nós achamos que essa dívida não pode ser paga com dinheiro. Ela é paga com solidariedade, com gestos políticos e com ajuda.”\r\n(Luiz Inácio Lula da Silva – Presidente do Brasil, G1)\r\nQuando o presidente Lula afirma que o Brasil tem “uma dívida histórica com os africanos”, ele está se referindo a que fato registrado na história de nosso país? ', 1, 1),
(29, NULL, 'No contexto da crise política que envolveu o Governo Luis Ignácio Lula da Silva em 2005, qual a solução consensual levantada pelo Congresso Nacional para reconquistar a credibilidade da sociedade civil na classe política?', 1, 1),
(30, NULL, 'As relações internacionais do Brasil, nessa primeira década do século XXI, apresentam, como uma de suas diretrizes: ', 1, 1),
(31, NULL, 'As migrações transnacionais, intensificadas e generalizadas nas últimas décadas do século XX, expressam aspectos particularmente importantes da problemática racial, visto como dilema também mundial. Deslocam-se indivíduos, famílias e coletividades para lugares próximos e distantes, envolvendo mudanças mais ou menos drásticas nas condições de vida e trabalho, em padrões e valores socioculturais. Deslocam-se para sociedades semelhantes ou radicalmente distintas, algumas vezes compreendendo culturas ou mesmo civilizações totalmente diversas.\r\nIANNI, O. A era do globalismo. Rio de Janeiro: Civilização Brasileira, 1996.\r\nA mobilidade populacional da segunda metade do século XX teve um papel importante na formação social e econômica de diversos estados nacionais. Uma razão para os movimentos migratórios nas últimas décadas e uma política migratória atual dos países desenvolvidos são: ', 11, 1),
(32, NULL, '“O número de imigrantes que vivem nos países da Organização para a Cooperação e Desenvolvimento Econômico (OCDE) aumentou em um terço na última década, apesar da recente queda dos fluxos migratórios provocada pela crise econômica iniciada em 2008, afirma um relatório publicado pela entidade nesta segunda-feira. Segundo a OCDE, que reúne 34 países, a maioria deles ricos, cerca de 110 milhões de imigrantes viviam nos países-membros da organização em 2009/2010, o equivalente a 9% da população total”.\r\nBBC Brasil, 03 dez. 2012.\r\nEm busca de melhores condições de vida, muitos imigrantes saem de países pobres em direção aos territórios de economias desenvolvidas. Essa procura intensifica-se porque nos países desenvolvidos: ', 11, 1),
(33, NULL, '(Ufg 2010) Um dos principais traços da dinâmica demográfica mundial é a migração internacional, que recria conflitos espaciais de diferentes ordens. Esse tipo de migração é explicado: ', 11, 1),
(34, NULL, '“Atualmente, os imigrantes marroquinos são um pouco menos de 700.000 na França. A França não é mais o país de predileção dos marroquinos, que se dirigem principalmente para a Espanha e a Itália. Uma imigração qualificada se desenvolve igualmente em direção aos Estados Unidos e ao Canadá.”\r\n\r\n(Le monde - Hors-série. L’Atlas de la France et des Français.Paris: Le Monde, 2014. p. 144) \r\nAlguns traços da imigração contemporânea revelam-se nesse texto. A esse respeito pode ser dito que: ', 11, 1),
(35, NULL, '“O desenvolvimento e o maior acesso ao transporte intercontinental, somados à facilidade de obtenção de informações sobre outros países por meio dos veículos de comunicação, impulsionaram o movimento de pessoas que buscam melhores condições de vida – nem sempre alcançadas fora do país de origem. Ao contrário do que se verifica com os fluxos econômicos, as fronteiras nacionais são reforçadas por governos de muitos países, principalmente dos desenvolvidos, para a entrada de imigrantes”.\r\nJOIA, A. L., GOETTEMS, A A. Geografia: leituras e interação. Vol. 02. 1º ed. São Paulo: Leya, 2013. p.275.\r\nUm exemplo mundialmente reconhecido de restrição à entrada de imigrantes conforme mencionado no trecho acima é: ', 11, 1),
(36, NULL, 'A produção agrícola é diversificada mundialmente devido às distintas condições físicas, econômicas, tecnológicas e culturais das regiões geográficas.\r\nA seguir, no primeiro bloco, são citados quatro sistemas agrícolas. No segundo bloco, são apresentadas as caracterizações de três deles.\r\nAssocie adequadamente as caracterizações aos respectivos sistemas.\r\n1.	Agricultura de jardinagem\r\n2.	Agricultura de “plantation”\r\n3.	Agricultura moderna\r\n4.	Agricultura ecológica\r\n( ) Predomínio de pequenas ou médias propriedades especializadas na rizicultura, que adotam técnicas milenares de cultivo e utilizam mão de obra familiar.\r\n( ) Produção obtida em médias e grandes propriedades altamente capitalizadas, que apresentam alta produtividade em decorrência, entre outros fatores, da seleção de sementes e da mecanização intensiva.\r\n( ) Produção obtida em pequenas e médias propriedades com mão de obra familiar, com uso de técnicas de controle biológico e informacional, fertilizantes orgânicos e rotação de culturas.\r\nA sequência correta de preenchimento dos parênteses, de cima para baixo, é ', 11, 1),
(37, NULL, 'Na agricultura moderna, os cultivos transgênicos foram adotados para: ', 11, 1),
(38, NULL, 'A partir da segunda metade do século XX, vários países do mundo, inclusive o Brasil, implantaram um pacote de medidas que recebeu o nome de Revolução Verde.\r\nAssinale a alternativa que indica duas características desse momento: ', 11, 1),
(39, NULL, 'A “Revolução Verde”, implementada em países latino-americanos e asiáticos nos anos 60 e 70, tinha como objetivo suprimir a fome e reduzir a pobreza de amplas parcelas da população. Entretanto, as promessas de modernização tecnológica da agricultura não foram cumpridas inteiramente, o que contribuiu, decisivamente, para a geração de novos problemas e aprofundou velhas desigualdades.\r\nA opção que faz referência aos efeitos da “Revolução Verde” é: ', 11, 1);
INSERT INTO `questao` (`IdQuestao`, `Imagem`, `Enunciado`, `idMateria`, `idArea`) VALUES
(40, , 'A imagem está relacionada a um sistema agrícola de subsistência típico de regiões densamente povoadas do globo terrestre.\r\nO sistema agrícola, a técnica utilizada e a região de ocorrência no globo são, respectivamente: ', 11, 1);
INSERT INTO `questao` (`IdQuestao`, `Imagem`, `Enunciado`, `idMateria`, `idArea`) VALUES
(41, , 'Na Amazônia, segundo o Instituto Nacional de Pesquisas Espaciais (INPE), nos últimos quinze anos foram desmatados 243.393 km2, o que representa 5% da área total da Amazônia Legal. Observe os três quadros, que representam três etapas do processo de ocupação da Amazônia.\r\n(Instituto de Pesquisa Ambiental da Amazônia – Ipam, adaptado.)\r\n \r\nAssinale a alternativa que contém a sucessão correta destas etapas. ', 11, 1);
INSERT INTO `questao` (`IdQuestao`, `Imagem`, `Enunciado`, `idMateria`, `idArea`) VALUES
(42, NULL, 'Mata de terra firme, mata de várzea e igapó são formações vegetais típicas deste bioma. Em razão do processo de uso e ocupação do território brasileiro e das ações dirigidas à preservação dos recursos naturais realizadas nas últimas décadas, este bioma constitui-se também naquele que guarda as maiores extensões de floresta nativa no Brasil, ainda que seu desmatamento não tenha sido completamente cessado. O texto refere-se ao bioma: ', 11, 1),
(43, NULL, 'Enquanto a controvérsia perdura, a ilegalidade na extração de madeira, associada a décadas de desmatamento que já destruiu 18% da Floresta Amazônica, induz o Brasil a consumir quase duas vezes mais madeira de matas nativas do que madeira plantada.\r\n(REALI et al. 2012, p. 34)\r\nSobre as características da Floresta Amazônica e as possíveis soluções para solucionar a questão de sua destruição, é correto afirmar:', 11, 1),
(44, NULL, 'Na medida em que o Governo Provisório consolidar os progressos da Revolução, será preciso apoiá-lo; na medida em que aquele governo se tornar contrarrevolucionário, será inadmissível que se o sustente.\r\nRelatório de Josef Stálin à Conferência Bolchevique, em 29 de março de 1917\r\nNo trecho do relatório citado, o autor faz referência: ', 11, 1),
(45, NULL, 'Os operários das fábricas e das usinas, assim como as tropas rebeldes, devem escolher sem demora seus representantes ao governo revolucionário provisório, que deve ser constituído sob a guarda do povo revolucionário amotinado e do exército.\r\nManifesto de 27 de fevereiro de 1917, in Marc Ferro. A Revolução Russa de 1917, 1974.\r\nO manifesto, lançado em meio às tensões de 1917 na Rússia, revela a posição do: ', 11, 1),
(46, NULL, ' Podemos definir um vetor, de maneira simplificada, como sendo um: ', 5, 2),
(47, NULL, 'Um vetor possui características básicas, que são:', 5, 2),
(48, NULL, 'A direção de um vetor pode ser', 5, 2),
(49, NULL, 'Duas retas paralelas entre si certamente têm', 5, 2),
(50, NULL, 'Quais são as duas regras principais para somar vetores?', 5, 2),
(51, NULL, 'Quanta energia deve ser dada a uma panela de ferro de 300 g para que sua temperatura seja elevada em 100 ºC? Considere o calor específico da panela como c = 450 J/ kg ºC.', 5, 2),
(52, NULL, 'Quanto calor precisa ser dado a uma placa de vidro de 0,3 kg para aumentar sua temperatura em 80 °C? (Considere o calor específico do vidro como 70 J/kg °C)', 5, 2),
(53, NULL, 'Depois de assar um bolo em um forno a gás, Zulmira observa que ela queima a mão ao tocar no tabuleiro, mas não a queima ao tocar no bolo. Considerando-se essa situação, é CORRETO afirmar que isso ocorre porque:', 5, 2),
(54, NULL, 'Uma quantidade de água líquida de massa m = 200 g, a uma temperatura de 30 °C, é colocada em uma calorímetro junto a 150 g de gelo a 0 °C. Após atingir o equilíbrio, dado que o calor específico da água é = 1,0 cal/(g .°C) e o calor latente de fusão do gelo é L = 80 cal/g. Qual a temperatura final da mistura gelo + água?', 5, 2),
(55, NULL, 'Qual a quantidade de calor sensível necessária para aquecer uma barra de ferro de 2kg de 20°C para 200°C? Dado: calor específico do ferro = 0,119cal/g°C.', 5, 2),
(56, NULL, 'Alguns gráficos cinemáticos avaliam a relação de algumas grandezas físicas como posição (s), velocidade (v) e aceleração (a) ao longo do tempo. Sabendo disso, qual gráfico cuja área é numericamente igual ao deslocamento é:', 5, 2),
(57, NULL, 'Se um móvel se desloca seguindo a equação s = (-35)+(7t), ele irá passar pela origem no instante:', 5, 2),
(58, NULL, 'Em um gráfico S x t, quando a curva cruza o eixo horizontal, diz-se que o corpo está passando:', 5, 2),
(59, NULL, 'Um móvel percorre metade de uma circunferência de raio R=5m. Determine o módulo de seu deslocamento vetorial e o valor de seu deslocamento escalar.', 5, 2),
(60, NULL, 'O gráfico de uma função horária da velocidade de um móvel no movimento uniformemente variado descreve seu comportamento em que:', 5, 2),
(61, NULL, '(Enem/2018)\r\nCorredores ecológicos visam mitigar os efeitos da fragmentação dos ecossistemas promovendo a ligação entre diferentes áreas, com o objetivo de proporcionar o deslocamento de animais, a dispersão de sementes e o aumento da cobertura vegetal. São instituídos com base em informações como estudos sobre o deslocamento de espécies, sua área de vida (área necessária para o suprimento de suas necessidades vitais e reprodutivas) e a distribuição de suas populações.\r\nNessa estratégia, a recuperação da biodiversidade é efetiva porque: ', 6, 3),
(62, NULL, '(Enem/2018)\r\nInsetos podem apresentar três tipos de desenvolvimento. Um deles, a holometabolia (desenvolvimento completo), é constituído pelas fases de ovo, larva, pupa e adulto sexualmente maduro, que ocupam diversos hábitats. Os insetos com holometabolia pertencem às ordens mais numerosas em termos de espécies conhecidas. Esse tipo de desenvolvimento está relacionado a um maior número de espécies em razão da\r\n', 6, 3),
(63, NULL, '(Enem/2018)\r\nA polinização, que viabiliza o transporte do grão de pólen de uma planta até o estigma de outra, pode ser\r\nrealizada biótica ou abioticamente. Nos processos abióticos, as plantas dependem de fatores como o vento e a água.\r\nA estratégia evolutiva que resulta em polinização mais eficiente quando esta depende do vento é o(a):\r\n', 6, 3),
(64, NULL, '(Enem/2018)\r\nO deserto é um bioma que se localiza em regiões de pouca umidade. A fauna é, predominantemente, composta por animais roedores, aves, répteis e artrópodes.\r\nUma adaptação, associada a esse bioma, presente nos seres vivos dos grupos citados é o(a):\r\n', 6, 3),
(65, NULL, '(Enem/2018)\r\nA utilização de extratos de origem natural tem recebido a atenção de pesquisadores em todo o mundo, principalmente nos países em desenvolvimento que são altamente acometidos por doenças infecciosas e parasitárias. Um bom exemplo dessa utilização são os produtos de origem botânica que combatem insetos.\r\nO uso desses produtos pode auxiliar no controle da:\r\n', 6, 3),
(66, NULL, '(Enem/2018)\r\nPara serem absorvidos pelas células do intestino humano, os lipídios ingeridos precisam ser primeiramente emulsificados. Nessa etapa da digestão, torna-se necessária a ação dos ácidos biliares, visto que os lipídios apresentam uma natureza apolar e são insolúveis em água.\r\nEsses ácidos atuam no processo de modo a:\r\n', 6, 3),
(67, NULL, '(Enem/2017)\r\nA terapia celular tem sido amplamente divulgada como revolucionária, por emitir a regeneração de tecidos a partir de células novas. Entretanto, a técnica de se introduzirem novas células em um tecido, para o tratamento de enfermidades em indivíduos, já era aplicada rotineiramente em hospitais.\r\nA que técnica refere-se o texto? ', 6, 3),
(68, NULL, '(Enem/2018)\r\nNo ciclo celular atuam moléculas reguladoras. Dentre elas, a proteína p53 é ativada em resposta a mutações no DNA, evitando a progressão do ciclo até que os danos sejam reparados, ou induzindo a célula à auto destruição.\r\nALBERTS, B. et. al. Fundamentos da biologia celular. Porto Alegre: Artmed, 2011 (adaptado)\r\nA ausência dessa proteína poderá favorecer a: ', 6, 3),
(69, NULL, '(Enem/2018)\r\nUm estudante relatou que o mapeamento do DNA da cevada foi quase todo concluído e seu código genético desvendado. Chamou a atenção para o número de genes que compõem esse código genético e que a semente da cevada, apesar de pequena, possui um genoma mais complexo que o humano, sendo boa parte desse código constituída de sequências repetidas. Nesse contexto, o conceito de código genético está abordado de forma equivocada.\r\nCientificamente esse conceito é definido como:\r\n', 6, 3),
(70, NULL, '(Enem/2017)\r\nA distrofia muscular Duchenne (DMD) é uma doença causada por uma mutação em um gene localizado no cromossomo X. Pesquisadores estudaram uma família na qual gêmeas monozigóticas eram portadoras de um alelo mutante recessivo para esse gene (heterozigóticas). O interessante é que uma das gêmeas apresentava o fenótipo relacionado ao alelo mutante, isto é, DMD, enquanto a sua irmã apresentava fenótipo normal.\r\nRICHARDS, C. S. et al. The American Journal of Human Genetics, n. 4, 1990 (adaptado)\r\nA diferença na manifestação da DMD entre as gêmeas pode ser explicada pela:\r\n', 6, 3),
(71, NULL, 'As proteínas são compostas:', 6, 3),
(72, NULL, 'Leia o texto a seguir, escrito por Jöns Jacob Berzelius em 1828. “Existem razões para supor que, nos animais e nas plantas, ocorrem milhares de processos catalíticos nos líquidos do corpo e nos tecidos. Tudo indica que, no futuro, descobriremos que a capacidade de os organismos vivos produzirem os mais variados tipos de compostos químicos reside no poder catalítico de seus tecidos.” A previsão de Berzelius estava correta, e hoje sabemos que o “poder catalítico” mencionado no texto deve-se ', 6, 3),
(73, NULL, 'Considere as seguintes afirmativas:\r\nI. As proteínas são substâncias de grande importância para os seres vivos: muitas participam da construção da matéria viva.\r\nII. As proteínas chamadas enzimas facilitam reações químicas celulares.\r\nIII. Os anticorpos, que também são proteínas, funcionam como substâncias de defesa.\r\nAssinale:\r\n', 6, 3),
(74, NULL, 'Para que uma célula possa produzir suas proteínas, ela precisa de aminoácidos, que podem ser obtidos de duas formas: ingeridos em alimentos ricos em proteínas, ou produzidos pelas células a partir de outras moléculas orgânicas. Nas alternativas abaixo marque respectivamente como são chamados os aminoácidos que um organismo não consegue produzir, e como são chamados os aminoácidos produzidos a partir de outras substâncias.', 6, 3);
