INSERT INTO `questao` (`IdQuestao`, `Imagem`, `Enunciado`, `idMateria`, `idArea`) VALUES
(76, NULL, 'Para Aristóteles o homem é um animal político, um agente moral, pois necessita da comunidade para viver feliz. Essa “felicidade pública” é privilégio de cidadãos livres, que vivem sob leis do Estado, e exclui os escravos, a quem os gregos tomavam por animais. De acordo com Aristóteles, sobre o que há de natural e instituído no modo de viver humano, é correto afirmar que:', 2, 1),
(77, NULL, 'Aristóteles, ao definir o homem como um “animal político”, objetivou destacar que o homem é essencialmente um', 2, 1),
(78, NULL, 'Na democracia do tipo aristotélica, o povo é soberano. Todavia, existe uma restrição no conceito de liberdade, pois viver como bem entender contraria esse conceito para Aristóteles. As leis são a liberdade, a salvação, pois a partir do momento em que o povo faz o que quer, como se nada fosse impossível, a democracia se torna uma tirania. Viver como bem entender torna a democracia um individualismo, contrário ao que é o bem comum.\r\nCom base no texto e no referido filósofo, pode-se inferir que a democracia: ', 2, 1),
(79, NULL, 'No início do século XX, a forma de organização dos sistemas produtivos que introduziu a produção em série de mercadorias e a ampliação do consumo, o controle intenso das atividades dos trabalhadores com recompensas e punições, o parcelamento das tarefas e a introdução da linha de montagem ficou conhecida como: ', 2, 1),
(80, NULL, 'No estudo do crescimento demográfico mundial, a teoria que considera a sociedade de consumo e os impactos do consumismo denomina-se: ', 2, 1),
(81, NULL, 'A Igreja foi a maior e mais poderosa instituição do Ocidente medieval. No entanto, durante a Idade Média, o poder e os ensinamentos da referida instituição foram questionados. Muitos dos que questionavam a Igreja foram percebidos e tidos como hereges. Sobre os hereges e as heresias medievais, podemos afirmar:  ', 2, 1),
(82, NULL, 'Em reação aos movimentos religiosos que contestavam os dogmas oficiais do catolicismo, a Igreja Romana tomou uma série de medidas que seriam conhecidas como Contra-Reforma.\r\n\r\nCom relação a esse contexto, assinale com V (verdadeiro) ou F (falso) as afirmações abaixo.\r\n\r\n( ) Uma das medidas mais drásticas adotadas em relação à reforma protestante foi a criação de uma nova instituição, a Santa Inquisição, responsável por punir e prevenir os desvios dogmáticos.\r\n\r\n( ) O Index Librorum Prohibitorum era uma lista de livros cujo conteúdo ameaçava ou contradizia as idéias oficiais da Igreja.\r\n\r\n( ) O Concílio de Trento reafirmou antigos dogmas católicos, entre os quais o de que o Papa é infalível, por representar a vontade de Deus na Terra.\r\n\r\n( ) O movimento da Contra Reforma evitou que o protestantismo se tornasse uma ameaça real em estados tradicionalmente católicos, como Espanha e Portugal.\r\n\r\nA sequência correta de preenchimento dos parênteses, de cima para baixo, é: ', 2, 1),
(83, NULL, 'Enquanto o pensamento de Santo Agostinho representa o desenvolvimento de uma filosofia cristã inspirada em Platão, o pensamento de São Tomás reabilita a filosofia de Aristóteles - até então vista sob suspeita pela Igreja -, mostrando ser possível desenvolver uma leitura de Aristóteles compatível com a doutrina cristã. O aristotelismo de São Tomás abriu caminho para o estudo da obra aristotélica e para a legitimação do interesse pelas ciências naturais, um dos principais motivos do interesse por Aristóteles nesse período.”\r\nMARCONDES, D. Textos básicos de filosofia. Rio de Janeiro: Zahar, 2005\r\nA Igreja Católica por muito tempo impediu a divulgação da obra de Aristóteles pelo fato de a obra aristotélica: ', 2, 1),
(84, NULL, 'A Igreja foi responsável direta por mais uma transformação, formidável e silenciosa, nos últimos séculos do\r\nImpério: a vulgarização da cultura clássica. Essa façanha fundamental da Igreja nascente indica seu verdadeiro lugar e função na passagem para o Feudalismo. A condição de existência da civilização da Antiguidade em meio aos séculos caóticos da Idade Média foi o caráter de resistência da Igreja. Ela foi a ponte entre duas épocas.\r\n(Perry Anderson. Passagens da Antiguidade\r\nao Feudalismo, 2016. Adaptado.)\r\n\r\nO excerto permite afirmar corretamente que a Igreja cristã: ', 2, 1),
(85, NULL, 'No século XVI, nas palavras de um estudioso, “reformar a Igreja significava reformar o mundo, porque a Igreja era o mundo”. Tendo em vista essa afirmação, é correto afirmar que:', 2, 1);
