(87, NULL, 'Sobre o Renascimento científico é correto dizer:', 2, 1),
(88, NULL, '“Ainda que a física moderna não se possa definir como ‘galileana’ (mesmo tendo renegado Galileu), o significado epistemológico (e simbólico) de Galileu para a ciência em geral permaneceu intacto”.\r\n\r\nFONTE: GINZBURG, Carlo. Mitos, emblemas, sinais: morfologia e história. São Paulo: Companhia das Letras, 1989, p. 156.\r\n\r\nPartindo do comentário apresentado, é correto afirmar: ', 2, 1),
(89, NULL, '“Não houve preocupação com as consequências da revolução copernicana senão depois de Giordano Bruno ter extraído dela certas consequências filosóficas. Bem depressa Giordano Bruno estava a afirmar a infinidade do mundo. Rejeitava, pois, por completo, a noção de “centro do universo”. O Sol, perdido o lugar privilegiado que Copérnico lhe atribuía, era um sol entre outros sóis, uma estrela entre estrelas.”\r\nDELUMEAU, Jean. “A civilização do Renascimento”. Lisboa: Editorial Estampa, 1994. p. 147. [Adaptado].\r\n \r\nO texto refere-se à importância dos pronunciamentos de Giordano Bruno para a constituição da noção moderna de Universo, que se relaciona com: ', 2, 1),
(90, NULL, 'Que nome mais técnico podemos dar à disputa entre a “valorização do Homem e da Natureza, em oposição ao divino e ao sobrenatural da Idade Média”, respectivamente:', 2, 1),
(91, NULL, 'As propriedades de um material utilizadas para distinguir-se um material do outro são divididas em Organolépticas, Físicas e Químicas. Associe a primeira coluna com a segunda coluna e assinale a alternativa que apresenta a ordem correta das respostas.\r\nPRIMEIRA COLUNA\r\n( A ) Propriedade Organoléptica\r\n( B ) Propriedade Física\r\n( C ) Propriedade Química\r\nSEGUNDA COLUNA\r\n( ) Sabor\r\n( ) Ponto de Fusão\r\n( ) Combustibilidade\r\n( ) Reatividade\r\n( ) Densidade\r\n( ) Odor\r\n( ) Estados da Matéria\r\n', 7, 2),
(92, NULL, 'Qual é a alternativa em que só aparecem misturas?', 7, 2);
