(94, , 'I e II são dois líquidos incolores e transparentes. Os dois foram aquecidos, separadamente, e mantidos em ebulição. Os valores das temperaturas (T) dos líquidos em função do tempo (t) de aquecimento são mostrados na figura a seguir\r\n \r\nCom base nessas informações, pode-se afirmar que: ', 7, 2),
(95, NULL, 'Durante o ciclo hidrológico ocorrem diversas mudanças de estado físico da água. Um exemplo de mudança de estado denominada sublimação ocorre quando: ', 7, 2),
(96, NULL, 'Analise as afirmações abaixo.\r\n\r\nPonto de fusão é a temperatura na qual ocorre a passagem do estado sólido para o líquido, a determinada pressão, PORQUE O ponto de fusão não depende da quantidade de material e, sim, do tipo, sendo uma grandeza extensiva.\r\nA esse respeito, conclui-se que: ', 7, 2),
(97, NULL, 'Alguns fenômenos observados no cotidiano estão relacionados com as mudanças ocorridas no estado físico da matéria. Por exemplo, no sistema constituído por água em um recipiente de barro, a água mantém-se fresca mesmo em dias quentes.\r\nA explicação para o fenômeno descrito é que, nas proximidades da superfície do recipiente, a: ', 7, 2),
(98, NULL, 'O café solúvel é obtido a partir do café comum dissolvido em água. A solução é congelada e, a seguir, diminui-se bruscamente a pressão. Com isso, a água passa direta e rapidamente para o estado gasoso, sendo eliminada do sistema por sucção. Com a remoção da água do sistema, por esse meio, resta o café em pó e seco. Identifique as mudanças de estado físico ocorridas neste processo: ', 7, 2),
(99, , 'Podemos determinar o estado físico de uma substância, observando sua temperatura de fusão e de ebulição. Observe o quadro abaixo:\r\n \r\nAssinale e marque a alternativa CORRETA. ', 7, 2),
(100, , 'Os processos envolvidos nas mudanças de estado físico da matéria, conforme figura a seguir, envolvem transferência de calor.\r\n \r\nDentre esses processos, os que envolvem, respectivamente, absorção e liberação de calor são: ', 7, 2);
INSERT INTO `questao` (`IdQuestao`, `Imagem`, `Enunciado`, `idMateria`, `idArea`) VALUES
(101, , 'Analise a tabela periódica e as seguintes afirmações a respeito do elemento químico enxofre (S)\r\nI. Tem massa atômica maior do que a do selênio (Se).\r\nII. Pode formar com o hidrogênio um composto molecular de fórmula H_22S.\r\nIII. A energia necessária para remover um elétron da camada mais externa do enxofre é maior do que para o sódio (Na).\r\nIV. Pode formar com o sódio (Na) um composto iônico de fórmula Na33S\r\nSão corretas apenas as afirmações: ', 7, 2);
INSERT INTO `questao` (`IdQuestao`, `Imagem`, `Enunciado`, `idMateria`, `idArea`) VALUES
(102, NULL, 'Recentemente, cientistas conseguiram produzir hidrogênio metálico, comprimindo hidrogênio molecular sob elevada pressão. As propriedades metálicas desse elemento são as mesmas dos demais elementos do grupo 1 da tabela de classificação periódica.\r\nEssa semelhança está relacionada com o subnível mais energético desses elementos, que corresponde a: ', 7, 2),
(103, NULL, 'Desde a descoberta de um tipo de radiação por Röentgen em 1895, a aplicação da radiação é extremamente importante na sociedade moderna, principalmente como fonte de geração de energia elétrica, pelas usinas nucleares, e como método de diagnóstico e tratamento na medicina. Entretanto, as desvantagens da sua utilização são os acidentes nucleares, os riscos de contaminação e o lixo radioativo.\r\nDe fato, no ano de 1986, em Chernobyl, ocorreu a explosão de uma usina, liberando cerca de 400 vezes mais contaminação que a bomba atômica de Hiroshima e matando mais de 4 mil pessoas. Chernobyl trabalhava com o átomo de Césio. Um ano depois, em Goiânia, houve um acidente com contaminação com Césio 137, o maior acidente nuclear do Brasil e o primeiro no mundo fora de uma usina nuclear.\r\nÉ correto afirmar que o elemento radioativo Césio, na tabela periódica, é classificado como: ', 7, 2),
(104, NULL, 'A tabela periódica é uma ferramenta muito útil para os químicos, embora ela tenha sido pensada a mais de um século atrás. Sobre a organização sistemática dos elementos, é verdadeiro afirmar-se que:', 7, 2),
(105, NULL, 'Atualmente, a Tabela Periódica apresenta 118 elementos distribuídos ordenadamente em 18 grupos ou famílias (linhas verticais) e em 7 períodos (linhas horizontais). Os elementos pertencentes ao grupo 15 apresentam:', 7, 2);
INSERT INTO `questao` (`IdQuestao`, `Imagem`, `Enunciado`, `idMateria`, `idArea`) VALUES
(106, , 'Observe a imagem a seguir:\r\n \r\nConsiderando a linguagem verbal e a não verbal, analise as seguintes afirmativas:\r\nI.O uso dos verbos “pensar” e “amar” vinculados aos advérbios “menos” e “mais” privilegiam o sentimentalismo em prol da razão.\r\nII.O uso da antítese indica que o ato de pensar e amar podem ser contraditórios.\r\nIII.O uso da hashtag (#) aproxima o texto do público consumidor jovem, uma vez que esta é muito utilizada em postagens nas redes sociais.\r\nEstão corretas as afirmativas:\r\n', 9, 4);
INSERT INTO `questao` (`IdQuestao`, `Imagem`, `Enunciado`, `idMateria`, `idArea`) VALUES
(107, NULL, 'Em busca de uma linguagem coloquial, os redatores do telejornalismo usam figuras de linguagem. Assinale a chamada que usa eufemismo (adaptado de O texto na TV, de Vera Iris Paternostro):', 9, 4),
(108, NULL, '(…) “Confeitaria do Custódio”. Muita gente certamente lhe não conhecia a casa por outra designação. Um nome, o próprio nome do dono, não tinha significação política ou figuração histórica, ódio nem amor, nada que chamasse a atenção dos dois regimes, e conseguintemente que pusesse em perigo os seus pastéis de Santa Clara, menos ainda a vida do proprietário e dos empregados. Por que é que não adotava esse alvitre? Gastava alguma coisa com a troca de uma palavra por outra, Custódio em vez de Império, mas as revoluções trazem sempre despesas.\r\n\r\n(Machado de Assis. Esaú e Jacó. Obra completa, 1904.)\r\n\r\nO fragmento, extraído do romance Esaú e Jacó, de Machado de Assis, narra a desventura de Custódio, dono de uma confeitaria no Rio de Janeiro, que, às vésperas da proclamação da República, mandou fazer uma placa com o nome “Confeitaria do Império” e agora temia desagradar ao novo regime. A ironia com que as dúvidas de Custódio são narradas representa o: ', 9, 4),
(109, NULL, '“eu gostava muito de passeá… saí com as minhas colegas… brincá na porta di casa di vôlei… andá de patins… bicicleta… quando eu levava um tombo ou outro… eu era a::… a palhaça da turma… ((risos))… eu acho que foi uma das fases mais… assim… gostosas da minha vida foi… essa fase de quinze… dos meus treze aos dezessete anos…”\r\nA.P.S., sexo feminino, 38 anos, nível de ensino fundamental. Projeto Fala Goiana, UFG. 2010 (inédito).\r\nUm aspecto da composição estrutural que caracteriza o relato pessoal de A.P.S. como modalidade falada da língua é: ', 9, 4),
(110, NULL, 'João e Maria\r\n\r\nAgora eu era herói\r\nE o meu cavalo só falava inglês\r\nA noiva do cowboy\r\nEra você além de outras três\r\nEu enfrentava batalhões\r\nOs alemães e os seus canhões\r\nGuardava o meu bodoque\r\nEnsaiava o rock\r\nPara as matinês (…)\r\n⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀Chico Buarque de Holanda\r\n\r\nQuanto ao tempo verbal, é CORRETO afirmar que, no texto anterior, ', 9, 4),
(111, NULL, 'Em: “– Perdi a mala! – um diz de cara acabrunhada”, “um” tem a função sintática de:', 9, 4),
(112, NULL, 'Em: “Eu era enfim, senhores, uma graça de alienado”, os termos em destaque são, respectivamente: ', 9, 4),
(113, NULL, 'Aponte a alternativa que expressa a função sintática do termo destacado: “Parece enfermo, seu irmão”.', 9, 4),
(114, NULL, 'Em “Ninguém parecia disposto ao trabalho naquela manhã de segunda-feira”, o termo sublinhado classifica-se como: ', 9, 4),
(115, NULL, '“Daqui estou vendo o amor\r\nIrritado, desapontado”\r\nCarlos Drummond de Andrade\r\n\r\nIdentifique a alternativa que traz, respectivamente, a classe gramatical e a função sintática das palavras destacadas: ', 9, 4),
(116, NULL, '14 coisas que você não deve jogar na privada\r\nNem no ralo. Elas poluem rios, lagos e mares, o que contamina o ambiente e os animais. Também\r\ndeixa mais difícil obter a água que nós mesmos usaremos. Alguns produtos podem causar\r\nentupimentos:\r\n– cotonete\r\n– medicamento e preservativo;\r\n– óleo de cozinha;\r\n– ponta de cigarro;\r\n– poeira de varrição de casa;\r\n– fio de cabelo e pelo de animais;\r\n– tinta que não seja à base de água;\r\n– querosene, gasolina, solvente, tíner.\r\nJogue esses produtos no lixo comum. Alguns deles, como óleo de cozinha, medicamento e tinta,\r\npodem ser levados a pontos de coleta especiais, que darão a destinação final adequada. MORGADO, M.; EMASA. Manual de etiqueta. Planeta Sustentável, jul.-ago. 2013 (adaptado).\r\nO texto tem objetivo educativo. Nesse sentido, além do foco no interlocutor, que caracteriza a função\r\nconativa da linguagem, predomina também nele a função referencial, que busca: ', 9, 4),
(117, NULL, 'O exercício da crônica\r\nEscrever prosa é uma arte ingrata. Eu digo prosa fiada, como faz um cronista; não a prosa de um ficcionista, na qual este é levado meio a tapas pelas personagens e situações que, azar dele, criou porque quis. Com um prosador do cotidiano, a coisa fia mais fino. Senta-se ele diante de sua máquina, olha através da janela e busca fundo em sua imaginação um fato qualquer, de preferência colhido no noticiário matutino, ou da véspera, em que, com as suas artimanhas peculiares, possa injetar um sangue novo. Se nada houver, resta-lhe o recurso de olhar em torno e esperar que, através de um processo associativo, surja-lhe de repente a crônica, provinda dos fatos e feitos de sua vida emocionalmente despertados pela concentração. Ou então, em última instância, recorrer ao assunto da falta de assunto, já bastante gasto, mas do qual, no ato de escrever, pode surgir o inesperado.\r\nMORAES, V. Para viver um grande amor: crônicas e poemas. São Paulo: Cia. das Letras, 1991.\r\nPredomina nesse texto a função da linguagem que se constitui: ', 9, 4),
(118, NULL, 'A biosfera, que reúne todos os ambientes onde se desenvolvem os seres vivos, se divide em unidades menores chamadas ecossistemas, que podem ser uma floresta, um deserto e até um lago. Um ecossistema tem múltiplos mecanismos que regulam o número de organismos dentro dele, controlando sua reprodução, crescimento e migrações.\r\n(DUARTE, M. O guia dos curiosos. São Paulo: Companhia das Letras, 1995.)\r\nPredomina no texto a função da linguagem: ', 9, 4),
(119, NULL, 'Novas tecnologias\r\nAtualmente, prevalece na mídia um discurso de exaltação das novas tecnologias, principalmente aquelas ligadas às atividades de telecomunicações. Expressões frequentes como “o futuro já chegou”, “maravilhas tecnológicas” e “conexão total com o mundo” “fetichizam” novos produtos, transformando-os em objetos do desejo, de consumo obrigatório. Por esse motivo carregamos hoje nos bolsos, bolsas e mochilas o “futuro” tão festejado.\r\nTodavia, não podemos reduzir-nos a meras vítimas de um aparelho midiático perverso, ou de um aparelho capitalista controlador. Há perversão, certamente, e controle, sem sombra de dúvida.\r\nEntretanto, desenvolvemos uma relação simbiótica de dependência mútua com os veículos de comunicação, que se estreita a cada imagem compartilhada e a cada dossiê pessoal transformado em objeto público de entretenimento.\r\nNão mais como aqueles acorrentados na caverna de Platão, somos livres para nos aprisionar, por espontânea vontade, a esta relação sadomasoquista com as estruturas midiáticas, na qual tanto controlamos quanto somos controlados.\r\nSAMPAIO A. S. A microfísica do espetáculo. Disponível em: http://observatoriodaimprensa.com.br. Acesso em: 1 mar 2013 (adaptado).\r\nAo escrever um artigo de opinião, o produtor precisa criar uma base de orientação linguística que permita alcançar os leitores e convencê-los com relação ao ponto de vista defendido. Diante disso, nesse texto, a escolha das formas verbais em destaque objetiva: ', 9, 4);
