(136, , 'Em um certo teatro, as poltronas são divididas em setores. A figura apresenta a vista do setor 3 desse\r\nteatro, no qual as cadeiras escuras estão reservadas e as claras não foram vendidas.\r\n \r\nA razão que representa a quantidade de cadeiras reservadas do setor 3 em relação ao total de\r\ncadeiras desse mesmo setor é:', 4, 2);
