(137, NULL, 'Para se construir um contrapiso, é comum, na constituição do concreto, se utilizar cimento, areia e\r\nbrita, na seguinte proporção: 1 parte de cimento, 4 partes de areia e 2 partes de brita. Para construir o\r\ncontrapiso de uma garagem, uma construtora encomendou um caminhão betoneira com 14m³ de\r\nconcreto.\r\nQual é o volume de cimento, em metros, na carga de concreto trazido pela betoneira? ', 4, 2),
(138, NULL, 'Em uma empresa de móveis, um cliente encomenda um guarda-roupa nas dimensões 220 cm de\r\naltura, 120 cm de largura e 50 cm de profundidade. Alguns dias depois, o projetista, com o desenho\r\nelaborado na escala 1: 8, entra em contato com o cliente para fazer sua apresentação. No momento\r\nda impressão, o profissional percebe que o desenho não caberia na folha de papel que costumava\r\nusar. Para resolver o problema, configurou a impressora para que a figura fosse reduzida em 20%. A\r\naltura, a largura e a profundidade do desenho impresso para a apresentação serão, respectivamente, ', 4, 2),
(139, NULL, 'Para uma atividade realizada no laboratório de Matemática, um aluno precisa construir uma maquete\r\nda quadra de esportes da escola que tem 28 m de comprimento por 12 m de largura. A maquete\r\ndeverá ser construída na escala de 1:250.\r\nQue medidas de comprimento e largura, em cm, o aluno utilizará na construção da maquete? ', 4, 2),
(140, NULL, 'Sabe-se que a distância real, em linha reta, de uma cidade A, localizada no estado de São Paulo, a uma cidade B, localizada no estado de Alagoas, é igual a 2 000 km. Um estudante, ao analisar um mapa, verificou com sua régua que a distância entre essas duas cidades, A e B, era 8 cm. Os dados nos indicam que o mapa observado pelo estudante está na escala de:', 4, 2),
(141, NULL, 'Há um novo impulso para produzir combustível a partir de gordura animal. Em abril, a High Plains\r\nBioenergy inaugurou uma biorrefinaria próxima a uma fábrica de processamento de carne suína em\r\nGuymon, Oklahoma. A refinaria converte a gordura do porco, juntamente com o o óleo vegetal, em\r\nbiodiesel. A expectativa da fábrica é transformar 14 milhões de quilogramas de banha em 112 milhões\r\nde litros de biodiesel.\r\nRevista Scientific American. Brasil, ago. 2009 (adaptado).\r\nConsidere que haja uma proporção direta entre a massa de banha transformada e o volume de\r\nbiodiesel produzido. Para produzir 48 milhões de litros de biodiesel, a massa de banha necessária, em\r\nquilogramas, será de, aproximadamente: ', 4, 2),
(142, NULL, 'Segundo uma pesquisa realizada em uma determinada cidade, numa população de 6.000 habitantes foi estimado que 1.920 pessoas são aposentadas.\r\nQual é a porcentagem de aposentados nessa cidade? ', 4, 2),
(143, NULL, 'No exame de seleção para o ano de 2017, uma faculdade ofereceu 504 vagas para seus cursos Integrados e, no exame de seleção para o ano de 2018, está oferecendo 630 vagas. Qual é o percentual de aumento do número de vagas para o ano de 2018? ', 4, 2),
(144, NULL, 'Nos Jogos Internos de uma faculdade de 2017, 30% dos atletas eram do sexo feminino. Quantos atletas ao todo participaram dos Jogos Internos do referido ano sabendo que havia 147 atletas do sexo masculino?', 4, 2),
(145, NULL, 'Analise as informações abaixo:\r\nI. O conjunto dos Números Naturais é subconjunto dos Números Inteiros.\r\nII. O conjunto dos Números Naturais é subconjunto dos Números Racionais.\r\nIII. O conjunto dos Números Naturais é subconjunto dos Números Irracionais. ', 4, 2),
(146, , 'Raios de luz solar estão atingindo a superfície de um lago formando um ângulo X com a sua superfície, conforme indica a figura.\r\nEm determinadas condições, pode-se supor que a intensidade luminosa desses raios, na superfície do lago, seja dada aproximadamente por I(x) = k . sen(x) sendo k uma constante, e supondo-se que X está entre 0° e 90º.\r\n \r\nQuando x = 30º, a intensidade luminosa se reduz a qual percentual de seu valor máximo? ', 4, 2),
(147, , 'Um cientista, em seus estudos para modelar a pressão arterial de uma pessoa, utiliza uma função do tipo P(t) = A + Bcos(kt) em que A, B e K são constantes reais positivas e t representa a variável tempo, medida em segundo. Considere que um batimento cardíaco representa o intervalo de tempo entre duas sucessivas pressões máximas.\r\nAo analisar um caso específico, o cientista obteve os dados:\r\n \r\nA função P(t) obtida, por este cientista, ao analisar o caso específico foi: ', 4, 2),
(148, , 'Um satélite de telecomunicações, t minutos após ter atingido sua órbita, está a r quilômetros de distância do centro da Terra. Quando r assume seus valores máximo e mínimo, diz-se que o satélite atingiu o apo¬geu e o perigeu, respectivamente. Suponha que, para esse satélite, o valor de r em função de t seja dado por:\r\n \r\nUma cientista monitora o movimento desse satélite para controlar o seu afastamento do centro da Terra. Para isso, ele precisa calcular a soma dos valores de r, no apogeu e no perigeu, representada por S. O cientista deveria concluir que, periodicamente, S atinge o valor de: ', 4, 2),
(149, , 'Em muitas cidades, os poluentes emitidos em excesso pelos veículos causam graves problemas a toda a população. Durante o inverno, a poluição demora mais para se dissipar na atmosfera, favorecendo o surgimento de doenças respiratórias. Suponha que a função\r\n \r\nrepresente o número de pessoas com doenças respiratórias registrado num Centro de Saúde, com x = 1 correspondendo ao mês de janeiro, x = 2, o mês de fevereiro e assim por diante. A soma do número de pessoas com doenças respiratórias registrado nos meses de janeiro, março, maio e julho é igual a: ', 4, 2);
