(152, NULL, 'Um robô, caminhando em linha reta, parte de um ponto A em direção a um ponto B, que distam entre si cinco metros. Ao chegar ao ponto B, gira novamente 60° à esquerda e caminha mais cinco metros, repetindo o movimento e o giro até retornar ao ponto de origem. O percurso do robô formará um polígono regular de:', 4, 2),
