(154, , 'Uma pessoa pegou um mapa rasgado em que constava um terreno delimitado por quatro ruas.\r\nNa parte visível do mapa, vê-se que o angulo formado pela rua Saturno e pela rua Júpiter e 90°; o ângulo formado pela rua Júpiter e pela rua Netuno e 110° e o ângulo formado pela rua Netuno e pela rua Marte e 100°. Nessas condições, a medida de um ângulo formado pelas ruas Marte e Saturno, na parte rasgada do mapa, é de: ', 4, 2);
