(155, , 'Na construção civil, é muito comum a utilização de ladrilhos ou azulejos com a forma de polígonos para o revestimento de pisos ou paredes. Entretanto, não são todas as combinações de polígonos que se prestam a pavimentar uma superfície plana, sem que haja falhas ou superposições de ladrilhos, como ilustram as figuras:\r\n \r\nA tabela traz uma relação de alguns polígonos regulares, com as respectivas medidas de seus ângulos internos.\r\n \r\nSe um arquiteto deseja utilizar uma combinação de dois tipos diferentes de ladrilhos entre os polígonos da tabela, sendo um deles octogonal, o outro tipo escolhido deverá ter a forma de um: ', 4, 2);
INSERT INTO `questao` (`IdQuestao`, `Imagem`, `Enunciado`, `idMateria`, `idArea`) VALUES
(156, NULL, '\"A QUICK DIP IN A DIRTY POOL\"\r\nThat\'s all it takes to expose you to all kinds of nasty microbes. What you _______ know before you jump in!\r\nAs temperatures soar, the cool blue waters of a swimming pool can seem pretty inviting. _______ perhaps you should look twice before you take that dip. Thousands of Americans _______ get sick this season from the unsanitary condition of their pool water, according to the Centers for Disease Control. The last thing you want to think about when you\'re swimming is what tiny creatures might be swimming beside you. But the fact is that any pool _______ be contaminated with parasites and bacteria. _______ you\'re not careful, you could find yourself in the emergency room with a badly upset stomach!\"\r\n(From \"A Quick Dip in a Dirty Pool\", Personal Time, Your Health, TIME, July 23, 2001, page 62)\r\nChoose the correct item to fill in the gaps.\r\n', 12, 4),
(157, NULL, 'Genetically modified (GM) foods are foods derived from organisms whose genetic material (DNA) has been modified in a way that does not occur naturally, e.g. through the introduction of a gene from a different organism. Currently available GM foods stem mostly from plants, but in the future foods derived from GM microorganisms or GM animals are likely to be introduced on the market. Most existing genetically modified crops have been developed to improve yield, through the introduction of resistance to plant diseases or of increased tolerance of herbicides.\r\nIn the future, genetic modification could be aimed at altering the nutrient content of food, reducing its allergenic potential, or improving the efficiency of food production systems. All GM foods should be assessed before being allowed on the market. FAO/WHO Codex guidelines exist for risk analysis of GM food.\r\n(www.who.int)\r\nNo trecho final do primeiro parágrafo “throughthe introduction of resistance to plant diseases”, o termo em destaque equivale, em português, a: ', 12, 4),
(158, NULL, 'Which of the following sentence is INCORRECT?', 12, 4),
(159, NULL, 'Looking at todays dictionaries\r\nChange is not something that people tend to associate with dictionaries. Changing these highly labor-intensive products is not to be undertaken lightly. The heavy cost of dictionary production, and the penalty to be paid for errors of judgement, have made it almost impossible for any radically new dictionary to 1come into being. Of 2course our dictionaries of the present do look a little different from their predecessors, and do behave a little better (it is becoming rarer now to find dictionaries with 3hermetically sealed nuggets of information coded up to defy interpretation by all but the dogged few); they may even come to you on a CD-ROM rather than in book form, but underneath these superficial modernizations lurks the same old dictionary. Some of the more innovative may introduce a few new types of information, but when it comes to setting out the meanings of words, giving them definitions or equivalents in another language, including examples, idioms, pronunciations, usage notes, cross reference and the 4score or so of other kinds of information, 5tradition rules supreme.\r\nATKINS, B.T.S.,Bilingual Dictionaries Past, Present and Future. 2002.\r\n \r\n\"come into being\" (ref. 1) means to: ', 12, 4),
(160, NULL, 'Water is life\r\nNearly seventy percent of the worlds fresh water is locked in ice. Most of the rest is in aquifers that we are draining much more quickly than the natural recharge rate. Two-thirds of our water is used to grow food. With eighty-three million more people on Earth each year, water demand will keep going up unless we change how we use it.\r\nAmericans use about 100 gallons* of water at home each day. Millions of the worlds poorest subsist on less than five gallons. 46 percent of people on Earth do not have water piped to their homes. Women in developing countries walk an average of 3.7 miles to get water. In fifteen years, 1.8 billion people will live in regions of severe water scarcity. *1 gallon = 3,785 liters (USA)\r\nAdaptado de: Barbara Kingsolver, National Geographic Magazine, April 2010.\r\n \r\nO segmentothe world’s poorest, presente na segunda sentença do segundo parágrafo quer dizer: ', 12, 4),
(161, NULL, 'Frejat\r\nIn 1985, Frejat, then guitarist for Barão Vermelho, hit the stage wearing green and yellow clothes. It was January 15th, the day in which Tancredo Neves was named president of Brazil. Cazuza sang \"Pro Dia Nascer Feliz\" with lots of enthusiasm.\r\nFrejat returns to the festival this year for a solo performance on October 1st.\r\nFonte: Disponível em: TAM. TAM nas nuvens. São Paulo: New Content Editora, set/2011.\r\n \r\nQue elemento linguístico do texto em inglês indica que Frejat já saiu da banda Barão Vermelho? ', 12, 4),
(162, NULL, 'Twilight\r\nTwilight is a 2008 American romantic vampire film based ______ Stephenie Meyer’s popular novel of the same name. It is the first film in The Twilight Saga film series. This film focuses on the development of the relationship between Bella Swan and Edward Cullen (a vampire), and the subsequent efforts of Cullen and his family to keep Swan safe ______ a coven of evil vampires.\r\nThe project was in development for approximately 3 years ______ Paramount Pictures, during which time a screen adaptation that differed significantly from the novel was written. Principal photography took 44 days and the film was primarily shot in Oregon.\r\nTwilight was theatrically released ______ November 21 2010, grossing over US$392 million worldwide and became the most purchased DVD of the year. The soundtrack was released in the same year. Following the success of the film, New Moon and Eclipse, the next two novels in the series, were produced as films the following year.\r\nAdapted from Wikipedia\r\nChoose the correct prepositions to fill in the gaps above.', 12, 4),
(163, NULL, 'UFRGS 2005\r\nIt was the summer that men first walked on the moon. I was very young back then, but I did not believe there would ever be future. I wanted to live dangerously, to push myself as far as I could go, and then see what happened to me when I got there. As it turned out, I 1nearly did not make it. Little by little, I saw my money dwindle to zero; I lost my apartment; I wound up living in the streets. If not for a girl named Kitty Wu, I probably 2would have starved to death. 3I had met her by chance only a short time before, but 4eventually I came to see that chance as a form of readiness a way of saving myself through the minds of others. That was the first part. From then on, strange things happened to me. I took the job with the old man in the wheelchair. I found out who my father was. I walked across the desert from Utah to California. That was a long time ago, of course, but I remeber them as the beginning of my life.\r\nAUSTER, Paul. Moon Palace. Chatham, Kent: Faber & Faber, 1989. p. 1.\r\nComplete the sentence below with the best alternative.\r\nMan walked .................... the moon  .................... the first time  .................... 1969. ', 12, 4),
(164, NULL, 'Answer question(s) according to text.\r\n    Bag your Bags, Bring em Back\r\n    The best way to recycle your plastic bags and film is to bring them back to a store that collects them for recycling. Just stuff them clean and dry into a single plastic bag, tie it up, and drop it into a plastic bag collection container found at the retail partners. Note: The stores listed below have partnered with King County to promote the Bag Your Bag campaign. There may be other stores not listed that accept plastic bags for recycling.\r\n    1Plastic bags and film collected at grocery stores stay cleaner and are easier for recycling facilities to process than bags placed in your home recycling collection bin. The bags are turned into new products like decking, benches, playground structures, and new plastic bags. And remember to bring along your reusable bags when you shop.\r\n    The Bag your Bags, Bring em Back campaign is a partnership between the King County Solid Waste Division and local grocery stores to show the best way to recycle plastic bags.\r\n(Retrieved and adapted from http://your.kingcounty.gov/solidwaste/garbage-recycling/bag-your-bags.asp. Access on September 28th, 2014)\r\nIn the title of the campaign, ‘Bag your Bags, Bring ‘em Back’, the words in bold are respectively classified as: ', 12, 4),
(165, NULL, 'Obama Criticizes Congress on Housing Market\r\nU.S. President Barack Obama has called out the Congress, especially Republicans, for not acting on proposals aimed at saving homeowners thousands of dollars.\r\nDuring Saturday’s weekly address, Obama said Congress has delayed taking action on a plan he sent them in February that he says would save homeowners $3,000 a year by refinancing their mortgages at a lower interest rate. [...]\r\nPresident Obama and Republican presidential candidate Mitt Romney face off Wednesday in the first of three debates ahead of elections on November 6.\r\nVoa News, September 29, 2012. (adapted)\r\nhttp://www.voanews.com/content/obama_criticizes_congress_on_housing_market/1517245.html\r\n\r\nNo último parágrafo, o verbo frasal “face off” pode ser substituído, sem prejuízo semântico do contexto, por ', 12, 4),
(166, NULL, 'Sleeping on stilts in the Amazon\r\nAs 75-year-old villager Antônio Gomes told us stories of growing up in Boca do Mamirauá, a tiny settlement in the northern Amazon rainforest, I tried to ignore the tiny blue flies biting through my trousers. Despite my interest in hearing how locals survive in this remote part of the Brazilian rainforest, now a part of the Mamirauá Sustainable Development Reserve, I was grateful to escape when he finished, finding refuge in one of the tall wooden houses.\r\nThe houses hover some 3m above the ground. They are not unusual: almost everything in the Mamirauá reserve is on stilts, even the chicken coop. It has to be. Although much of Brazil is currently suffering one of the worst droughts in decades, this part of the Amazon is almost completely flooded for the six-month wet season. By April, the end of the rainy season, the river rises up to 10m high and overflows its banks. As a result, all living things in the forest, including locals, must adopt an amphibious lifestyle. Even the jaguars have learned to adapt by living in tree branches when the floods arrive.\r\nOnly 1,000 tourists per year are allowed to visit Mamirauá, which, at 57,000sqkm, is the largest wildlife reserve in the country. Created in 1984 to save the once-endangered uakari monkey, the reserve is the most carefully managed and protected part of the Amazon – and is also home to what many consider Brazil’s most successful sustainable tourist resort, the Uakari Floating Lodge. “If [the reserve] had not been created,” guide Francisco Nogeuira said, “the rivers and lakes would be empty of fish, and who knows how many trees would remain today?\"\r\nDisponível em:.\r\n \r\nIn the last paragraph, it is possible to find sentences in ', 12, 4),
(167, NULL, 'UEG 2005\r\nA Tribute to Martin Luther King, Jr.\r\nMary Miché\r\nChorus:\r\nMartin Luther King, you make my spirit sing.\r\nYou mean so much to me, because you taught us how to be free.\r\nYou loved everybody black or white,\r\nAnd you taught us it is no good to fight,\r\nBut just to stand up for what is right,\r\nAnd let your love shine like a light.\r\nYou bravely walked the streets of this land.\r\nYou marched with others, hand in hand.\r\nYou taught us that we all should stand,\r\nTogether, for equality in this land.\r\nYou spoke of justice loud and long,\r\nWith patience and love you fought against wrong,\r\nAs brothers and sisters we will be strong,\r\nAnd so to you we give this song.\r\nDisponível em:Acesso em:18 maio 2005.\r\n \r\nCom base no texto, verifica-se que ', 12, 4),
(168, NULL, 'Stoodi\r\nSaudi Arabia ends gender segregation in restaurants\r\n \r\nSaudi Arabia will no longer require restaurants to have separate entrances segregated by sex, the government says. Previously, it was mandatory to have one entrance for families and women, and another for men on their own.\r\nThe restrictions had already been quietly eased in practice, with many restaurants, cafes and other meeting places no longer enforcing segregation. A series of sweeping social reforms in Saudi Arabia has been accompanied by an intensified crackdown on dissent.\r\nEarlier this year, a royal decree allowed Saudi women to travel abroad without a male guardians permission, and in 2018 the Gulf kingdom ended a decades-long ban on female drivers.\r\nBut activists complain that many laws discriminatory against women remain in place. And several prominent women s rights advocates have been arrested even as the government has made reforms.\r\nOn Sunday, the Saudi ministry of municipalities said that restaurants would no longer need to maintain sex-segregated entrances. Instead it would be left up to businesses to decide. Until now, inside restaurants, families and women were usually cut off and separated from men on their own by screens.\r\nFonte: https://www.bbc.com/news/world-middle-east-50708384_editado\r\n \r\n“The restrictions”, “Saudi women” and “families and women were” grifados no texto podem ser substituídos pelos seguintes pronomes: ', 12, 4),
(169, NULL, 'Assinale a alternativa que preenche corretamente as lacunas:\r\n\r\nI         you as soon as my work        .\r\n', 12, 4),
(170, NULL, 'PUCRS 2013\r\nEveryday conversational narratives of personal experience might be regarded as the country 3cousins of more well-wrought narratives. The work of archaeologist Nicholas Toth revolutionized the understanding of Stone Age tools. Prior to Toth’s studies, the received perspective was that early hominids chipped a cobble in such a way that it could be used 1as a pick or a hand ax. Researchers considered the splintered flakes as waste products and examined them for information about techniques used to shape the stone core tool. While others were analyzing the morphological shapes and cognitive correlates of the 4chipped cores, Toth, in a radical turnabout, discovered that the flakes were the primary tools and that the large stone was an incidental by-product, possibly a secondary tool. The flakes 5turned out to be “extremely effective cutting tools” for animals, wood, 6hides, and other work. We posit that, like stone flakes, mundane conversational narratives of personal experience constitute the prototype of narrative activity rather than the 2flawed by-product of more artful and planned narrative discourse.\r\nOCHS, E. & CAPPS, L. (2001)Living Narrative – creating lives in everyday storytelling.Harvard University Press, England, p.3.\r\nGlossary:\r\nChip – small piece of something, like wood or glass, mainly when it has broken off something.\r\nCobble – small round-shaped stone; cobblestones.\r\nWell-wrought – skillfully shaped or decorated.\r\nO termo “as” é empregado com o mesmo sentido em “could be used as a pick” (ref. 1) e em ', 12, 4);
